import {useSelector} from 'react-redux'

const Allusers = () => {

    const {systemUsers} = useSelector(state => state.systemUsers)

    return (
        <>
        {
            users.map((user) => {
                return (
                    <div key={user._id}>
                        <p>Name: {user.FirstName} {user.LastName}</p><br/>
                        <p>User Name: {user.Username}</p><br/>
                        <p>Session Time Out: {user.SessionTimeout}</p><br/>
                        <p>Created Date: {user.CreatedDate.slice(0, 10)}</p><br/>
                        <p>Permissions:</p>
                        <ul>
                        {
                            user.Permissions.map((permission) => {
                                return (
                                    <li>{permission}</li>
                                )
                            })
                        }
                        </ul>
                    </div>
                )
            })
        }
        </>
    )
}

export default Allusers
